        {no:1,name:"Abhinav",lastname:"Singh",username:"suab"},
        {no:1,name:"Abhinav",lastname:"Singh",username:"suab"}]};
    }
    render(){
        return(
            <div style={{marginTop:"5em"}}>
            <Table striped bordered condensed hover>
  <thead>
    <tr>
      <th>serial</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
  </tbody>
</Table>
</div>
        )
    }
}
export default AssigningDeveloper;
